    top: 0px;
    height: 55px;
    align-items: center;
    border-bottom: 0.2px solid rgba(0, 0, 0, 0.172);
    padding: 10px;
    background-color: $secondary;
    box-sizing: border-box;
    justify-content: space-between;
    width: 100%;
    z-index: 100;
    
    .title{
        font-weight: 900;
        font-size: 28px;
        font-family: 'Style Script', cursive;
        a{
            text-decoration: none;
            color: $text;
        }
