    .search-container{
        position: relative;
        #search{
            width: 300px;
            height: 25px;
            background-color: rgba(231, 229, 229, 0.269);
            border-radius: 5px;
            border: 0.2px solid rgba(0, 0, 0, 0.172);
            color: $text;
            outline: none;
            font-family: 'Poppins', sans-serif;
        }
       
    }
    ::-webkit-input-placeholder{
        text-align: center;
    }
    .navicon{
        .toggle-search{
            background-color: $secondary;
            border: none;
            cursor: pointer;
            margin: 0 7px 0 0;
            .nav-btn-icon{
                height: 25px;
                color: $text;
            }
            display: none;
        }
        .toggle-theme{
            background-color: $secondary;
            border: none;
            cursor: pointer;
            .nav-btn-icon{
                height: 25px;
                color: $text;
                path{
                    d: $navicon;
                }
            }
        }
        .addicon{
            color: $text;
            height: 25px;
        }
        .sub-icon{
            height: 20px;
            margin: 0 7px;
            filter: $naviColor;
            
        }
        .user-image{
            height: 20px;
            width: 20px;
            margin: 0 7px;
