                        content: '';
                        border-top: 1px solid $text;
                        position: absolute;
                        width: 150px;
                        left: 0px;
                        top: 0px;
                        opacity: 0.5;
                        
                    }
                }
            }
        }
        .show{
            display: flex;
            transition: 500ms ease-in;
        }
    }
    .nav-btn{
        display: flex;
        justify-content: center;
        .toggle-theme{
            background-color: $secondary;
            border: none;
            cursor: pointer;
            .nav-btn-icon{
                height: 25px;
                color: $text;
                
                path{
                    d: $navicon;
                }
            }
        }
        
    }
    .btn{
        margin: 0 5px;
        button{
            height: 25px;
            width: 70px;
            font-weight: 700;
            cursor: pointer;
        }
    }
    .login{
        background-color: rgba($color: #0073ff, $alpha: 1.0);
        color: white;
